import React, { useEffect, useState } from "react";
import { View, Text, TouchableOpacity } from "react-native";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  ResponsiveContainer,
  PieChart,
  Pie,
  Cell,
  Legend,
} from "recharts";
import styles from "./styles";

const COLORS = ["#f59e0b", "#facc15"];

export default function App() {
  const [data, setData] = useState([]);
  const [mode, setMode] = useState("week"); // "day" | "week" | "month"

  // Fetch backend data
  useEffect(() => {
    fetch("http://127.0.0.1:8000/sunshine")
      .then((res) => res.json())
      .then((json) => setData(json.sunshine || []))
      .catch((err) => console.error(err));
  }, []);

  // Filter data depending on mode
  const getFilteredData = () => {
    if (mode === "day") {
      return data.slice(-1); // last day only
    }
    if (mode === "week") {
      return data.slice(-7); // last 7 entries
    }
    if (mode === "month") {
      return data.slice(-30); // last 30 entries
    }
    return data;
  };

  const filteredData = getFilteredData();

  // Calculate insights
  const avg =
    filteredData.reduce((sum, d) => sum + d.hours, 0) /
    (filteredData.length || 1);
  const max = Math.max(...filteredData.map((d) => d.hours), 0);
  const min = Math.min(...filteredData.map((d) => d.hours), 0);

  // Pie chart data (comparison)
  const pieData =
    mode === "week"
      ? [
          { name: "Last week", value: 6.3 },
          { name: "This week", value: avg.toFixed(1) },
        ]
      : [];

  return (
    <View style={styles.container}>
      <View style={styles.wrapper}>
        {/* Header */}
        <Text style={styles.headerTitle}>SUNSHINE DURATION</Text>
        <Text style={styles.headerSub}>SOURCE: FAST API (MOCK)</Text>
        <Text style={styles.headerSub}>UPDATED : AUG 28, 22:00</Text>

        {/* Toggle */}
        <View style={styles.toggleRow}>
          {["day", "week", "month"].map((item) => (
            <TouchableOpacity
              key={item}
              style={[
                styles.toggle,
                mode === item && styles.toggleActive,
              ]}
              onPress={() => setMode(item)}
            >
              <Text
                style={[
                  styles.toggleText,
                  mode === item && styles.toggleTextActive,
                ]}
              >
                {item.toUpperCase()}
              </Text>
            </TouchableOpacity>
          ))}
        </View>

        {/* Charts Row */}
        <View style={styles.row}>
          {/* Weekly Trend (or day/month) */}
          <View style={[styles.card, styles.flex1]}>
            <Text style={styles.cardTitle}>
              {mode.charAt(0).toUpperCase() + mode.slice(1)} Trend
            </Text>
            <View style={{ width: "100%", height: 250 }}>
              <ResponsiveContainer>
                <LineChart data={filteredData}>
                  <CartesianGrid stroke="#e5e7eb" />
                  <XAxis dataKey="date" />
                  <YAxis />
                  <Tooltip />
                  <Line
                    type="monotone"
                    dataKey="hours"
                    stroke="#f59e0b"
                    strokeWidth={2}
                    dot={{ r: 5 }}
                  />
                </LineChart>
              </ResponsiveContainer>
            </View>
            <Text style={styles.legend}>⬤ Sunshine (hr)</Text>
          </View>

          {/* Insights */}
          <View style={[styles.card, styles.flex1]}>
            <Text style={styles.cardTitle}>Insights</Text>
            <View style={styles.insightsRow}>
              <View style={styles.pill}>
                <Text style={styles.pillDot}>⬤</Text>
                <Text style={styles.pillText}>AVG {avg.toFixed(1)}H</Text>
              </View>
              <View style={styles.pill}>
                <Text style={styles.pillDot}>⬤</Text>
                <Text style={styles.pillText}>MAX {max.toFixed(1)}H</Text>
              </View>
              <View style={styles.pill}>
                <Text style={styles.pillDot}>⬤</Text>
                <Text style={styles.pillText}>MIN {min.toFixed(1)}H</Text>
              </View>
            </View>
          </View>

          {/* Historical trends */}
          <View style={[styles.card, styles.flex1]}>
            <Text style={styles.cardTitle}>Historical trends</Text>
            {pieData.length > 0 ? (
              <View style={{ width: "100%", height: 250 }}>
                <ResponsiveContainer>
                  <PieChart>
                    <Pie
                      data={pieData}
                      dataKey="value"
                      cx="50%"
                      cy="50%"
                      outerRadius={60}
                      label
                    >
                      {pieData.map((entry, i) => (
                        <Cell
                          key={`cell-${i}`}
                          fill={COLORS[i % COLORS.length]}
                        />
                      ))}
                    </Pie>
                    <Legend />
                  </PieChart>
                </ResponsiveContainer>
              </View>
            ) : (
              <Text>No historical comparison for {mode}</Text>
            )}
          </View>
        </View>

        {/* Footer */}
        <Text style={styles.footer}>
          Timezone: IST · Units: hours/day {"\n"}Data randomized for demo
        </Text>
      </View>
    </View>
  );
}
